'''Licenca MIT''' është një licencë e me softuar të lirë me origjinë në [[Massachusetts Institute of Technology]] (MIT).<ref>Lawrence Rosen, OPEN SOURCE LICENSING, p.85 (Prentice Hall PTR, 1st ed. 2004)</ref> Kjo është një licencë me softuar të lirë, që do të thotë se ajo lejon ripërdorimin brenda softuerit pronësor duke dhënë të gjitha kopjet e softuerit të licencuar gjithashtu përfshirjen e një kopje të termave të kësaj licence MIT dhe njoftimin e autorit. Softueri i tillë pronësor ruan natyrën e tij të pronarit edhe pse kjo përfshin softuare sipas licencës MIT. Licenca është gjithashtu e pajtueshme me GPL, që do të thotë se GPL lejon kombinim dhe rishpërndarjen e softuerveë që përdorin licencën MIT.<ref>{{cite web|url=https://www.gnu.org/licenses/license-list.html#GPLCompatibleLicenses |title=Various Licenses and Comments about Them |accessdate=17 korrik 2013 |publisher=Free Software Foundation }}</ref>
Paketa software të njohura që përdorin një nga versionet e Licencës MIT përfshijnë Expat, platforma e zhvillimit të bibliotekave Mono klasë, Ruby në binarët, Node.js, Lua (nga versioni 5.0 e tutje), jQuery dhe Sistemin e X Window, për të cilat ishte shkruar dhe licenca .
